import React, { useState } from 'react';
import styles from './ClubRegister.module.css';
const ClubRegister = () => {
  const [formData, setFormData] = useState({
    cname: '',
    caname: '',
    cpname: '',
    cmail: '',
    cid: '',
    cmobile: '',
    cpassword: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const res = await fetch('http://localhost:3001/api/clubs/register', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json'
        },
        body: JSON.stringify(formData)
      });

      const result = await res.json();
      alert(result.message);

      if (res.ok) {
        window.location.href = '/login-club'; // Navigate to club login page
      }
    } catch (err) {
      console.error('Frontend error:', err);
      alert('Registration failed (Frontend)');
    }
  };

  return (
    <div className={styles.container}>
  <header>Club Registration</header>

  <form onSubmit={handleSubmit}>
    <div className={styles.form}>
      <div className={styles.details}>
        <span className={styles.title}>Club Details</span>

        <div className={styles.fields}>
          <div className={styles.inputField}>
            <label htmlFor="cname">Club Name</label>
            <input
              type="text"
              id="cname"
              name="cname"
              value={formData.cname}
              onChange={handleChange}
              required
            />
          </div>

          <div className={styles.inputField}>
            <label htmlFor="caname">Advisor Name</label>
            <input
              type="text"
              id="caname"
              name="caname"
              value={formData.caname}
              onChange={handleChange}
              required
            />
          </div>

          <div className={styles.inputField}>
            <label htmlFor="cpname">President Name</label>
            <input
              type="text"
              id="cpname"
              name="cpname"
              value={formData.cpname}
              onChange={handleChange}
              required
            />
          </div>

          <div className={styles.inputField}>
            <label htmlFor="cmail">Club Email</label>
            <input
              type="email"
              id="cmail"
              name="cmail"
              value={formData.cmail}
              onChange={handleChange}
              required
            />
          </div>

          <div className={styles.inputField}>
            <label htmlFor="cid">Club ID</label>
            <input
              type="number"
              id="cid"
              name="cid"
              value={formData.cid}
              onChange={handleChange}
              required
              min="10000000"
              max="99999999"
            />
          </div>

          <div className={styles.inputField}>
            <label htmlFor="cmobile">Mobile Number</label>
            <input
              type="number"
              id="cmobile"
              name="cmobile"
              value={formData.cmobile}
              onChange={handleChange}
              required
            />
          </div>

          <div className={styles.inputField}>
            <label htmlFor="cpassword">Choose Password</label>
            <input
              type="password"
              id="cpassword"
              name="cpassword"
              value={formData.cpassword}
              onChange={handleChange}
              required
            />
          </div>
        </div>
      </div>

      <button type="submit" className={styles.submit}>
        <span className={styles.btnText}>Submit</span>
      </button>

      <p className={styles.register}>
        Back to <a href="/login-club">Login</a>
      </p>
    </div>
  </form>
</div>


  );
};

export default ClubRegister;
